(5, '{\"ar\":\"\\u0645\\u0627 \\u0647\\u0648 FixMax\",\"en\":\"What is FixMax\",\"hi\":\"\\u092b\\u093f\\u0915\\u094d\\u0938\\u092e\\u0948\\u0915\\u094d\\u0938 \\u0915\\u094d\\u092f\\u093e \\u0939\\u0948?\",\"ru\":\"\\u0427\\u0442\\u043e \\u0442\\u0430\\u043a\\u043e\\u0435 \\u0424\\u0438\\u043a\\u0441\\u041c\\u0430\\u043a\\u0441\",\"ur\":\"FixMax \\u06a9\\u06cc\\u0627 \\u06c1\\u06d2\\u061f\"}', '{\"ar\":\"FixMax \\u0639\\u0628\\u0627\\u0631\\u0629 \\u0639\\u0646 \\u0645\\u0646\\u0635\\u0629 \\u0639\\u0628\\u0631 \\u0627\\u0644\\u0625\\u0646\\u062a\\u0631\\u0646\\u062a \\u0644\\u0644\\u0645\\u0633\\u062a\\u062e\\u062f\\u0645 \\u0644\\u0644\\u062d\\u0635\\u0648\\u0644 \\u0639\\u0644\\u0649 \\u062e\\u062f\\u0645\\u0627\\u062a \\u0627\\u0644\\u0635\\u064a\\u0627\\u0646\\u0629. \\u064a\\u0645\\u0643\\u0646\\u0643 \\u062a\\u0646\\u0632\\u064a\\u0644 \\u0627\\u0644\\u062a\\u0637\\u0628\\u064a\\u0642 \\u0623\\u0648 \\u0627\\u0633\\u062a\\u062e\\u062f\\u0627\\u0645 \\u0631\\u0627\\u0628\\u0637 \\u0627\\u0644\\u0648\\u064a\\u0628 \\u0644\\u062e\\u062f\\u0645\\u0627\\u062a \\u0627\\u0644\\u062d\\u062c\\u0632 \\u0645\\u0646 \\u0627\\u0644\\u0645\\u0648\\u0631\\u062f\\u064a\\u0646 \\u0627\\u0644\\u0645\\u0633\\u062c\\u0644\\u064a\\u0646.\",\"en\":\"FixMax is an online platform for user to get maintenance services. You can download the application or use the web link for booking services from the registered suppliers.\",\"hi\":\"\\u092b\\u093f\\u0915\\u094d\\u0938\\u092e\\u0948\\u0915\\u094d\\u0938 \\u0909\\u092a\\u092f\\u094b\\u0917\\u0915\\u0930\\u094d\\u0924\\u093e \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0930\\u0916\\u0930\\u0916\\u093e\\u0935 \\u0938\\u0947\\u0935\\u093e\\u090f\\u0902 \\u092a\\u094d\\u0930\\u093e\\u092a\\u094d\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u090f\\u0915 \\u0911\\u0928\\u0932\\u093e\\u0907\\u0928 \\u092e\\u0902\\u091a \\u0939\\u0948\\u0964 \\u0906\\u092a \\u092a\\u0902\\u091c\\u0940\\u0915\\u0943\\u0924 \\u0906\\u092a\\u0942\\u0930\\u094d\\u0924\\u093f\\u0915\\u0930\\u094d\\u0924\\u093e\\u0913\\u0902 \\u0938\\u0947 \\u0938\\u0947\\u0935\\u093e\\u0913\\u0902 \\u0915\\u0940 \\u092c\\u0941\\u0915\\u093f\\u0902\\u0917 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u090f\\u092a\\u094d\\u0932\\u093f\\u0915\\u0947\\u0936\\u0928 \\u0921\\u093e\\u0909\\u0928\\u0932\\u094b\\u0921 \\u0915\\u0930 \\u0938\\u0915\\u0924\\u0947 \\u0939\\u0948\\u0902 \\u092f\\u093e \\u0935\\u0947\\u092c \\u0932\\u093f\\u0902\\u0915 \\u0915\\u093e \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0930 \\u0938\\u0915\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964\",\"ru\":\"FixMax \\u2014 \\u044d\\u0442\\u043e \\u043e\\u043d\\u043b\\u0430\\u0439\\u043d-\\u043f\\u043b\\u0430\\u0442\\u0444\\u043e\\u0440\\u043c\\u0430, \\u043d\\u0430 \\u043a\\u043e\\u0442\\u043e\\u0440\\u043e\\u0439 \\u043f\\u043e\\u043b\\u044c\\u0437\\u043e\\u0432\\u0430\\u0442\\u0435\\u043b\\u044c \\u043c\\u043e\\u0436\\u0435\\u0442 \\u043f\\u043e\\u043b\\u0443\\u0447\\u0438\\u0442\\u044c \\u0443\\u0441\\u043b\\u0443\\u0433\\u0438 \\u043f\\u043e \\u0442\\u0435\\u0445\\u043d\\u0438\\u0447\\u0435\\u0441\\u043a\\u043e\\u043c\\u0443 \\u043e\\u0431\\u0441\\u043b\\u0443\\u0436\\u0438\\u0432\\u0430\\u043d\\u0438\\u044e. \\u0412\\u044b \\u043c\\u043e\\u0436\\u0435\\u0442\\u0435 \\u0441\\u043a\\u0430\\u0447\\u0430\\u0442\\u044c \\u043f\\u0440\\u0438\\u043b\\u043e\\u0436\\u0435\\u043d\\u0438\\u0435 \\u0438\\u043b\\u0438 \\u0432\\u043e\\u0441\\u043f\\u043e\\u043b\\u044c\\u0437\\u043e\\u0432\\u0430\\u0442\\u044c\\u0441\\u044f \\u0432\\u0435\\u0431-\\u0441\\u0441\\u044b\\u043b\\u043a\\u043e\\u0439 \\u0434\\u043b\\u044f \\u0431\\u0440\\u043e\\u043d\\u0438\\u0440\\u043e\\u0432\\u0430\\u043d\\u0438\\u044f \\u0443\\u0441\\u043b\\u0443\\u0433 \\u0443 \\u0437\\u0430\\u0440\\u0435\\u0433\\u0438\\u0441\\u0442\\u0440\\u0438\\u0440\\u043e\\u0432\\u0430\\u043d\\u043d\\u044b\\u0445 \\u043f\\u043e\\u0441\\u0442\\u0430\\u0432\\u0449\\u0438\\u043a\\u043e\\u0432.\",\"ur\":\"\\u0641\\u06a9\\